import api from "./baseApi";

export const collectionApi = {
  getCollections(params, cancelToken) {
    return api.get("/api/collections", { params, cancelToken });
  },
  postCollections(params) {
    return api.post("/api/collections", params);
  },
  getDetailCollection(id) {
    return api.get(`/api/collections/${id}`);
  },
  editCollection(id, params) {
    return api.put(`/api/collections/${id}`, params);
  },
  delete(collectionId) {
    return api.delete(`/api/collections/${collectionId}`);
  },
};
